import React, { useState, useEffect } from 'react';
import {
  Box,
  Card,
  TableContainer,
  Table,
  TableBody,
  TableCell,
  TableHead,
  TableRow,
  TablePagination,
  Typography,
  Paper,
  Chip,
} from '@mui/material';

// Dữ liệu mẫu cho đơn hàng
const mockOrders = [
  {
    id: 1,
    orderStatus: 'Chưa giải quyết',
    createAt: '2024-12-28T17:11:21.092+00:00',
    paymentType: 0,
    statusPayment: 0,
    totalItem: 2,
    totalPrice: 500000,
  },
  {
    id: 2,
    orderStatus: 'Đang giao hàng',
    createAt: '2024-12-29T10:20:00.000+00:00',
    paymentType: 1,
    statusPayment: 1,
    totalItem: 3,
    totalPrice: 750000,
  },
  {
    id: 3,
    orderStatus: 'Đã hoàn thành',
    createAt: '2024-12-30T14:45:00.000+00:00',
    paymentType: 2,
    statusPayment: 1,
    totalItem: 1,
    totalPrice: 200000,
  },
  {
    id: 4,
    orderStatus: 'Chưa giải quyết',
    createAt: '2025-01-01T08:15:00.000+00:00',
    paymentType: 0,
    statusPayment: 0,
    totalItem: 4,
    totalPrice: 1000000,
  },
  {
    id: 5,
    orderStatus: 'Đã giao hàng',
    createAt: '2025-01-02T09:30:00.000+00:00',
    paymentType: 1,
    statusPayment: 1,
    totalItem: 2,
    totalPrice: 500000,
  },
];

// Map paymentType và statusPayment sang text
const paymentTypes = ['Tiền mặt', 'Chuyển khoản', 'Thẻ tín dụng'];
const paymentStatuses = ['Chưa thanh toán', 'Đã thanh toán'];

const Orderss = () => {
  // State cho dữ liệu và phân trang
  const [orders, setOrders] = useState([]);
  const [page, setPage] = useState(0);
  const [rowsPerPage, setRowsPerPage] = useState(3); // Mỗi trang 3 dòng

  useEffect(() => {
    // Giả lập fetch API
    const fetchOrders = () => {
      // Giả lập phân trang từ mockOrders
      const start = page * rowsPerPage;
      const end = start + rowsPerPage;
      setOrders(mockOrders.slice(start, end));
    };

    fetchOrders();
  }, [page, rowsPerPage]);

  // Xử lý chuyển trang
  const handleChangePage = (event, newPage) => {
    setPage(newPage);
  };

  // Xử lý thay đổi số lượng dòng mỗi trang
  const handleChangeRowsPerPage = (event) => {
    setRowsPerPage(parseInt(event.target.value, 10));
    setPage(0); // Reset về trang đầu tiên
  };

  return (
    <Box p={3}>
      <Card>
        <Typography variant="h5" sx={{ p: 2 }}>
          Quản lý Đơn Hàng
        </Typography>
        <TableContainer component={Paper}>
          <Table>
            <TableHead>
              <TableRow>
                <TableCell>#</TableCell>
                <TableCell>Trạng thái</TableCell>
                <TableCell>Ngày tạo</TableCell>
                <TableCell>Phương thức thanh toán</TableCell>
                <TableCell>Trạng thái thanh toán</TableCell>
                <TableCell>Tổng số món</TableCell>
                <TableCell>Tổng giá</TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {orders.map((order, index) => (
                <TableRow key={order.id}>
                  <TableCell>{order.id}</TableCell>
                  <TableCell>
                    <Chip
                      label={order.orderStatus}
                      color={
                        order.orderStatus === 'Chưa giải quyết'
                          ? 'warning'
                          : order.orderStatus === 'Đang giao hàng'
                          ? 'primary'
                          : 'success'
                      }
                    />
                  </TableCell>
                  <TableCell>
                    {new Date(order.createAt).toLocaleString()}
                  </TableCell>
                  <TableCell>{paymentTypes[order.paymentType]}</TableCell>
                  <TableCell>{paymentStatuses[order.statusPayment]}</TableCell>
                  <TableCell>{order.totalItem}</TableCell>
                  <TableCell>
                    {order.totalPrice.toLocaleString()} VND
                  </TableCell>
                </TableRow>
              ))}
            </TableBody>
          </Table>
        </TableContainer>
        {/* Phân trang */}
        <TablePagination
          component="div"
          count={mockOrders.length}
          page={page}
          onPageChange={handleChangePage}
          rowsPerPage={rowsPerPage}
          onRowsPerPageChange={handleChangeRowsPerPage}
          rowsPerPageOptions={[3, 5, 10]}
        />
      </Card>
    </Box>
  );
};

export default Orderss;
